import React from 'react';
import { useNavigate } from 'react-router-dom';
import './AboutPage.css';
import logo from "../hit.png";

const AboutPage = () => {
  const navigate = useNavigate();
  const isLoggedIn = localStorage.getItem('access');
  
  return (
    <div className="about-container">
      <button 
        onClick={() => navigate(isLoggedIn ? '/menu' : '/')}
        className="about-back-button"
      >
        {isLoggedIn ? 'Back to Menu' : 'Back to Login'}
      </button>

      <div className="about-header">
        <img src={logo} alt="Company Logo" className="about-logo" />
        <h1>About Communication LTD</h1>
      </div>
      
      {/* Rest of your about page content */}
    </div>
  );
};

export default AboutPage;
